module default {

  # LIST DATA
  type Country {
    required property name -> str;
  }

  #ADMIN
  type Admin {
      required property created_at -> datetime { default := datetime_current() };
      required property email -> str { constraint exclusive };
      link password := .<admin[IS AdminPassword];
      link profile := .<admin[IS AdminProfile];
  }

  type AdminPassword {
      required property hash -> str;
      required link admin -> Admin {
        constraint exclusive;  # one-to-one
        on target delete delete source;
      }
  }


  type AdminProfile {
      property first_name -> str;
      property last_name -> str;
      property name :=
          .first_name ++ ' ' ++ .last_name
      IF EXISTS .last_name
      ELSE .first_name;	
      required link admin -> Admin {
        constraint exclusive;  # one-to-one
        on target delete delete source;
      }
  }

  #USER
  type User {
      required property created_at -> datetime { default := datetime_current() };
      required property email -> str { constraint exclusive };
      property onboarded -> bool;
      link password := .<user[IS Password];
      link profile := .<user[IS UserProfile];


      #multi link notes := .<user[is Note] { allow_empty };
      multi link notes := .<user[is Note];

      #multi link organisationTeams -> OrganisationTeam {
      #  on target delete delete source;
      #};

  }

  type Password {
      required property hash -> str;
      required link user -> User {
        constraint exclusive;  # one-to-one
        on target delete delete source;
      }
  }

  type UserProfile {
      property first_name -> str;
      property last_name -> str;
      property name := .first_name ++ ' ' ++ .last_name
      IF EXISTS .last_name
      ELSE .first_name;	

      required link user -> User {
        constraint exclusive;  # one-to-one
        on target delete delete source;
      }
  }

  type Note {
      required property title -> str;
      required property body -> str;
      required property created_at -> datetime { default := datetime_current() };

      required link user -> User {
        on target delete delete source;
       };
  }

  # ORGANISATION
  type Organisation {
    required property name -> str;
  }

  type OrganisationProfile {
    required property name -> str;
    required property address -> str;
    required property addressNr -> str;
    required property postal -> str;
    required property city -> str;
    required link country -> Country;

    required link organisation -> Organisation {
      constraint exclusive; # one-to-one
      on target delete delete source;
    }
  }

  type OrganisationTeam {
    property role -> int16;
    property invitedEmail -> str;
    property orgId -> int16;
    property code -> str;

    required link user -> User {
      on target delete delete source;
    };
    required link organisation -> Organisation {
      on target delete delete source;
    };

  }

  type OrganisationSubscription {
    property customerId -> str;
    property subscriptionId -> str;
    property planId -> str;
    property status -> str;
    property currentPeriodStart -> datetime { default := datetime_current() };
    property currentPeriodEnd -> datetime;
    property cancelAtPeriodEnd -> bool;

    required link organisation -> Organisation {
      constraint exclusive; # one-to-one
      on target delete delete source;
    }

  }

}
